import React from 'react';
import './styles.css'
function Header() {
  return (
    <header>
      <nav>
        <ul className ='app-header'>
          <li ><a href="/">Главная</a></li>
          <li><a href="/about">О нас</a></li>
          <li><a href="/contact">Контакты</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
